import React from 'react';
import './Card.css';
export default function DisplayCard({
    url,
    name,
    price
}) {

    return (
        <div className="display_card">
            <img src={url}
            height="200px"
            width="300px"
            ></img>

            <div className="container">
                <h3>name {name}</h3>
                <h3>price {price} </h3>
            </div>
        </div>
    );
}
